export const styles = {
  appBar: {
    backgroundColor: "#4580bf",
    align: "right",
    height: "60px",
    '& .MuiToolbar-regular': {
      minHeight: "60px"
    }
  },
  name: {
    color: "#dbdbdb",
  },
  link: {
    textTransform: "unset",
    color: "#dbdbdb",
    margin: "0 20px",
    textDecoration: "unset",

    "&:hover": {
     color: "#f1f1f1",
    }
  },
  logo: {
    textTransform: "unset",
    color: "#dbdbdb",
    margin: "0 20px",
    textDecoration: "unset",
  },
  rightToolbar: {
    marginLeft: "auto",
    marginRight: 10
  },
}
